import { ethers } from 'hardhat';

async function main() {
  const signer = (await ethers.getSigners())[0];
  console.log(`signer address: ${signer.address}`);
  const facrotyAddress = '0xC9C58BD6c6c1CAc12F8A174670BEC9e4C0924181';
  const WEIGHTED_POOL_CREATION_CODE =
    '';
  const factory = await ethers.getContractAt('InitializableWeightedPoolFactory', facrotyAddress);
  await factory.init(WEIGHTED_POOL_CREATION_CODE);
  console.log(`Done!`);
}

main()
  .then(() => process.exit(0))
  .catch((error) => {
    console.error(error);
    process.exit(1);
  });
